% % run the clear-sky detection routine.
% csd = Inman2015CSD(ghi,ghics,dni,dnics,1); %plot figure set to 1 so an output is plotted
%
function csd = Inman2015CSD(ghi,ghics,dni,dnics,plot_figure)
%% safety checks
if ~iscolumn(ghi)
    ghi = ghi';
    if ~iscolumn(ghi)
        error('var ghi must be a column vector')
    end
end
if ~iscolumn(ghics)
    ghics = ghics';
    if ~iscolumn(ghics)
        error('var ghics must be a column vector')
    end
end
if ~iscolumn(dni)
    dni = dni';
    if ~iscolumn(dni)
        error('var dni must be a column vector')
    end
end
if ~iscolumn(dnics)
    dnics = dnics';
    if ~iscolumn(dnics)
        error('var dnics must be a column vector')
    end
end
if length(unique([length(ghi),length(ghics),length(dni),length(dnics)]))~=1
    error('vars must be equal in length')
end
%% Inman thresholds
thresholds_ghi = [100, 100, 50, 0.01, 10.0];
thresholds_dni = [200, 200, 100, 0.015, 15];

window_size = 10;

%% Moving Window Vectorisation
% To avoid a loop, the ghi time series are cacatonated into a t-by-window
% matrix. To keep the methodology flexible to window size, strings and
% evals are taken advantage of.

ghi_window = hankel(ghi,[ghi(end),NaN(1,window_size-1)]);
ghics_window = hankel(ghics,[ghics(end),NaN(1,window_size-1)]);
dni_window = hankel(dni,[dni(end),NaN(1,window_size-1)]);
dnics_window = hankel(dnics,[dnics(end),NaN(1,window_size-1)]);

%% Criteria analysis
% clearsky criteria (five items per subcomponent)
cg1 = ones(size(ghi));
cg2 = ones(size(ghi));
cg3 = ones(size(ghi));
cg4 = ones(size(ghi));
cg5 = ones(size(ghi));

cd1 = ones(size(ghi));
cd2 = ones(size(ghi));
cd3 = ones(size(ghi));
cd4 = ones(size(ghi));
cd5 = ones(size(ghi));

% 1) average irradiance
cg1(abs(nanmean(ghi_window,2) - nanmean(ghics_window,2)) < thresholds_ghi(1))=0;
cd1(abs(nanmean(dni_window,2) - nanmean(dnics_window,2)) < thresholds_dni(1))=0;

% 2) max irradiance
cg2(abs(nanmax(ghi_window,[],2) - nanmax(ghics_window,[],2)) < thresholds_ghi(2))=0;
cd2(abs(nanmax(dni_window,[],2) - nanmax(dnics_window,[],2)) < thresholds_dni(2))=0;

% 3) irradiance increment
diff_ghi = ghi_window(:,2:end)-ghi_window(:,1:end-1);
diff_dni = dni_window(:,2:end)-dni_window(:,1:end-1);
diff_ghics = ghics_window(:,2:end)-ghics_window(:,1:end-1);
diff_dnics = dnics_window(:,2:end)-dnics_window(:,1:end-1);
cg3(abs(nansum(sqrt(diff_ghi .^ 2),2) - nansum(sqrt(diff_ghics.^2),2))< thresholds_ghi(3))=0;
cd3(abs(nansum(sqrt(diff_dni .^ 2),2) - nansum(sqrt(diff_dnics.^2),2))< thresholds_dni(3))=0;

% 4) std of irradiance increment
cg4(abs(std(diff_ghi,0,2,'omitnan') ./ nanmean(ghi_window,2)- std(diff_ghics,0,2,'omitnan') ./ nanmean(ghics_window,2)) < thresholds_ghi(4))=0;
cd4(abs(std(diff_dni,0,2,'omitnan') ./ nanmean(dni_window,2)- std(diff_dnics,0,2,'omitnan') ./ nanmean(dnics_window,2)) < thresholds_dni(4))=0;

% 5) max irradiance increment
cg5(nanmax(abs(diff_ghi - diff_ghics),[],2) < thresholds_ghi(5)) = 0;
cd5(nanmax(abs(diff_dni - diff_dnics),[],2) < thresholds_dni(5)) = 0;

% sum of the criteria (0=all criteria met)
criteria_ghi = cg1+cg2+cg3+cg4+cg5;
criteria_dni = cd1+cd2+cd3+cd4+cd5;

% both GHI and DNI tests must corroborate in order for csd to be detected
criteria = criteria_ghi + criteria_dni;

% outputs
csd = zeros(size(ghi));
csd(criteria~=0)=1;
        
%% figure example
if exist('plot_figure','var')
    figure('name','Inman CSD example','color','w');
    hold on
    plot(ghi)
    CSD = ghi;
    CSD(csd==1)=NaN;
    plot(CSD,'linewidth',2,'color','k')
    hold off    
    legend('GHI','CSD')
    ylabel('Irradiance [Wm^{-2}]')    
    set(gca,'xtick',[]);
    xlabel('Time [min]')
end
end
